        img: "https://photo-cms-kienthuc.zadn.vn/zoom/800/uploaded/hongngan/2018_05_09/e/chum-anh-chung-minh-shiba-inu-la-giong-cho-dang-yeu-nhat-hinh-13.jpg"
    },

    {
        name: "Tran Minh Phu",
        age: 19,
        img: "https://photo-cms-kienthuc.zadn.vn/zoom/800/uploaded/hongngan/2018_05_09/e/chum-anh-chung-minh-shiba-inu-la-giong-cho-dang-yeu-nhat-hinh-13.jpg"

    },
    {
        name: "Tran Minh Phu",
        age: 19,
        img: "https://photo-cms-kienthuc.zadn.vn/zoom/800/uploaded/hongngan/2018_05_09/e/chum-anh-chung-minh-shiba-inu-la-giong-cho-dang-yeu-nhat-hinh-13.jpg"

    },
    {
        name: "Tran Minh Phu",
        age: 19,
        img: "https://photo-cms-kienthuc.zadn.vn/zoom/800/uploaded/hongngan/2018_05_09/e/chum-anh-chung-minh-shiba-inu-la-giong-cho-dang-yeu-nhat-hinh-13.jpg"

    },
    {
        name: "Tran Minh Phu",
        age: 19
    },
    {
        name: "Tran Minh Phu",
        age: 19
    },
    {
        name: "Tran Minh Phu",
        age: 19
    },
    {
        name: "Tran Minh Phu",
        age: 19
    },

]
export const Product = () => {

    return <div className="Product d-flex">
        {productList.map((product) =>
            <div className="row">
                <div className="col-4 card">
                    <h1>{product.name}</h1>
                    <span>{product.age}</span>
                    <img src={product.img} />
                    <button className="btn btn-primary">Show Detail</button>
                </div>
            </div>
        )}
    </div>
}
